var bxbHeadExt = {
  bxbScriptSrc: '/bphf/res/js/bxb.src.1.4.js',
  addLoadEvent: function(func) {'use strict'; var oldonload = window.onload;
    if (typeof window.onload !== 'function') {window.onload = func;}
    else {window.onload = function() {if (oldonload) {oldonload();} func();};}
  },
  bxbExists: function() {'use strict'; var a,b;
    if(typeof bxb === 'undefined'){a = document.getElementsByTagName('body')[0];
      b = document.createElement('script');b.setAttribute('type','text/javascript');
      b.setAttribute('src',bxbHeadExt.bxbScriptSrc);a.appendChild(b);
    }
  },
  init:function() {'use strict'; this.addLoadEvent(this.bxbExists);}
};
try {bxbHeadExt.init();} catch(err){}

AFL.StayAndPlay = {

  randomFromInterval : function (from,to) {
    return Math.floor(Math.random()*(to-from+1)+from);
  },

  selectTab: function () {
    var objArray = $('div.sponsor-hub > ul.ui-tabs-nav > .ui-state-default');

    if (objArray.length > 1) {
      var random = this.randomFromInterval(0, (objArray.length-1));

      var tabName = "#tab-sh-";

      for (var i=0; i < objArray.length; i++) {

        var liItem = objArray[i];
        if (i==random) {
          $(objArray[i]).addClass("ui-tabs-selected ui-state-active");
          $(tabName + (i+1)).removeClass("ui-tabs-hide");
        } else {
          $(objArray[i]).removeClass("ui-tabs-selected ui-state-active");
          $(tabName + (i+1)).addClass("ui-tabs-hide");
        }
      }
    }
  }

};

$(function() {
  AFL.StayAndPlay.selectTab() ;
});

